import React from "react";




const Expense = () => {
    const [showForm, setShowForm] = useState(false);




    return(
        <div>
            <div>
                Expense Tracker
            </div>

            <div>
            <button  onClick={() => {
            setShowForm(!showForm);
            
            }}>
            {showForm ? 'Cancel' : 'Add New Expense'}
            </button>
            </div>

            <div>
                <h2>My Expenses</h2>

            </div>
        </div>

    )
}


export default Expense;
